import React from 'react';
import Card from "../UI/Card/Card";
import './LogsForm.css'
const LogsForm = () => {
    return (
        <Card>
            <form>
                <div>
                    <label htmlFor="date" className="form-label">日期</label>
                    <input id='date' type="date"/>
                </div>
                <div>
                    <label htmlFor="desc" className="form-label">学习内容</label>
                    <input id='desc' type="text"/>
                </div>
                <div>
                    <label htmlFor="time" className="form-label">时长</label>
                    <input id='time' type="date"/>
                </div>
            </form>
        </Card>
    );
};

export default LogsForm;
